import React from 'react'
import { FlatList, StyleSheet } from 'react-native'

// Import Components
import SingleJobItem from '../../components/jobs/SingleJobItem'
import ListItemSeparator from '../../components/ListItemSeparator'

// Demo Data
const demoData = [
  {
    id: 1,
    title: 'Software Engineer',
    description:
      'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed pretium semper laoreet.',
    expected_salary: '1500',
  },
  {
    id: 2,
    title: 'Electrical Engineer',
    description:
      'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed pretium semper laoreet.',
    expected_salary: '1800',
  },
  {
    id: 3,
    title: 'Mechanical Engineer',
    description:
      'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed pretium semper laoreet.',
    expected_salary: '1200',
  },
  {
    id: 4,
    title: 'Data Analyst',
    description:
      'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed pretium semper laoreet.',
    expected_salary: '3500',
  },
  {
    id: 5,
    title: 'Data Analyst',
    description:
      'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed pretium semper laoreet.',
    expected_salary: '3500',
  },
  {
    id: 6,
    title: 'Data Analyst',
    description:
      'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed pretium semper laoreet.',
    expected_salary: '3500',
  },
  {
    id: 7,
    title: 'Data Analyst',
    description:
      'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed pretium semper laoreet.',
    expected_salary: '3500',
  },
]

const JobsListScreen = ({ navigation }) => {
  return (
    <FlatList
      data={demoData}
      keyExtractor={(d) => d.id.toString()}
      renderItem={({ item }) => (
        <SingleJobItem
          title={item.title}
          description={item.description}
          expected_salary={item.expected_salary}
          onPress={() => navigation.navigate('JobDetail')}
        />
      )}
      ItemSeparatorComponent={ListItemSeparator}
      style={styles.container}
    />
  )
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: 'white',
  },
})

export default JobsListScreen
